    /* Merge all records into table Clientele.Clients. Randomize by gender & fill in Gender field. */
    SET @MaleCounter = 1
    SET @FemaleCounter = 1
    SET @MaxMaleNumber = (SELECT MAX(ClientsMaleID) FROM #ClientsMale)
    SET @MaxFemaleNumber = (SELECT MAX(ClientsFemaleID) FROM #ClientsFemale)

    WHILE @MaleCounter <= @MaxMaleNumber OR @FemaleCounter <= @MaxFemaleNumber
    BEGIN

        /* Randomly generate 0 or 1 */
        DECLARE @TablePick BIT
        SET @TablePick = (SELECT FLOOR(RAND()*2))

        /* Insert a record from table with male clients */
        IF @TablePick = 0 AND @MaleCounter <= @MaxMaleNumber
            BEGIN
                INSERT INTO Clientele.Clients ([FirstName],[Surname],[Gender],[Telephone],[Email],[HomeAddress])
                    SELECT [FirstName],[Surname],'m', [Telephone],[Email],[HomeAddress]
                    FROM #ClientsMale
                    WHERE ClientsMaleID = @MaleCounter
                SET @MaleCounter += 1
            END

        /* Insert a record from table with female clients */
        ELSE
            IF @FemaleCounter <= @MaxFemaleNumber
                BEGIN
                    INSERT INTO Clientele.Clients ([FirstName],[Surname],[Gender],[Telephone],[Email],[HomeAddress])
                        SELECT [FirstName],[Surname],'f', [Telephone],[Email],[HomeAddress]
                        FROM #ClientsFemale
                        WHERE ClientsFemaleID = @FemaleCounter
                    SET @FemaleCounter += 1
                END
        ELSE
            CONTINUE
    END

    /* Drop all temporary objects */
    DROP TABLE #ClientsMale
    DROP TABLE #ClientsFemale
END

